script: |
  super -f text -I q5744.spq | sort > q5744.out

inputs:
  - name: q5744.spq
    data: |
      SELECT + - 17 AS col2, + ( + 45 ) - + - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 12 + + - 34 NOT BETWEEN + + col2 AND col2;
  - name: tab2

outputs:
  - name: q5744.out
    data: |
